INSERT INTO `life_faqs` (`cd_faq`, `cd_categoria`, `ds_pergunta`, `ds_resposta`, `cd_usuario_cadastro`, `cd_usuario_ultima_atualizacao`, `eh_ativo`, `dt_cadastro`, `dt_ultima_atualizacao`, `lk_seo`, `nr_ordem`) VALUES
(1, 1, 'como usar: um?', 'Nam quis lorem vel lectus bibendum finibus sed vel arcu. Praesent dictum ex nisi, sed sagittis elit imperdiet id. Cras ornare pulvinar dolor a congue. Quisque pretium et diam sit amet placerat.    ', 53, NULL, 1, '2017-02-09', NULL, 'como-usar-um', 1),
(2, 2, 'como usar: dois?', 'Nunc vitae mauris id dui auctor pellentesque in nec lorem. Aenean nec mi quis orci convallis ultricies ut in metus. Nunc fringilla sollicitudin purus, sed tristique nulla condimentum in. Mauris vitae ante diam. Aliquam porttitor fermentum rhoncus. Maecenas id nisl varius, pharetra mauris id, accumsan sapien. In ultrices mauris sit amet porta gravida.      \n', 53, 53, 1, '2017-02-09', '2017-02-14', 'como-usar-dois', 1),
(3, 3, 'como usar: três?', 'Maecenas facilisis id nisi quis lacinia. Suspendisse lobortis efficitur est, ut fringilla est sollicitudin ut. Praesent efficitur justo nec risus hendrerit rhoncus. Nullam luctus et dolor eu dignissim. Fusce odio lectus, accumsan a lacus ut, pellentesque feugiat lectus. ', 53, 53, 1, '2017-02-09', '2017-02-14', 'como-usar-tres', 1),
(4, 3, 'como usar: mais um? \n', 'Maecenas facilisis id nisi quis lacinia. Suspendisse lobortis efficitur est, ut fringilla est sollicitudin ut. Praesent efficitur justo nec risus hendrerit rhoncus. Nullam luctus et dolor eu dignissim.', 53, 53, 1, '2017-02-10', '2017-02-14', 'como-usar-mais-um-\n', 1);
