(5434, 53, '2017-02-14 16:01:15', '201.54.206.13', 'UPDATE life_faqs SET cd_categoria = ''3'', ds_pergunta = ''como usar: mais um? \n'', ds_resposta = ''Maecenas facilisis id nisi quis lacinia. Suspendisse lobortis efficitur est, ut fringilla est sollicitudin ut. Praesent efficitur justo nec risus hendrerit rhoncus. Nullam luctus et dolor eu dignissim.'', nr_ordem = ''1'', eh_ativo = ''1'', lk_seo = ''como-usar-mais-um-\n'', cd_usuario_ultima_atualizacao = ''53'', dt_ultima_atualizacao = ''2017-02-14'' WHERE cd_faq = ''4'' ;', 'faqs'),
(5435, 53, '2017-02-14 16:01:45', '201.54.206.13', 'UPDATE life_faqs SET cd_categoria = ''2'', ds_pergunta = ''como usar: dois?'', ds_resposta = ''Nunc vitae mauris id dui auctor pellentesque in nec lorem. Aenean nec mi quis orci convallis ultricies ut in metus. Nunc fringilla sollicitudin purus, sed tristique nulla condimentum in. Mauris vitae ante diam. Aliquam porttitor fermentum rhoncus. Maecenas id nisl varius, pharetra mauris id, accumsan sapien. In ultrices mauris sit amet porta gravida.      \n'', nr_ordem = ''1'', eh_ativo = ''1'', lk_seo = ''como-usar-dois'', cd_usuario_ultima_atualizacao = ''53'', dt_ultima_atualizacao = ''2017-02-14'' WHERE cd_faq = ''2'' ;', 'faqs'),
(5436, 53, '2017-02-14 16:01:58', '201.54.206.13', 'UPDATE life_faqs SET cd_categoria = ''3'', ds_pergunta = ''como usar: três?'', ds_resposta = ''Maecenas facilisis id nisi quis lacinia. Suspendisse lobortis efficitur est, ut fringilla est sollicitudin ut. Praesent efficitur justo nec risus hendrerit rhoncus. Nullam luctus et dolor eu dignissim. Fusce odio lectus, accumsan a lacus ut, pellentesque feugiat lectus. '', nr_ordem = ''1'', eh_ativo = ''1'', lk_seo = ''como-usar-tres'', cd_usuario_ultima_atualizacao = ''53'', dt_ultima_atualizacao = ''2017-02-14'' WHERE cd_faq = ''3'' ;', 'faqs'),
